import { IProduct } from "../models"

interface ProductProps{
    product: IProduct
}

export function Product({product}: ProductProps){
    return(
        <div className="border py-2 px-2 rounded flex flex-col items-center mb-2">
           <img src={product.image}/>
           {product.title }
        </div>
    )
}
